import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import AuthService from '../services/auth.service';
import '../styles/Auth.css';

function RegisterPage() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    username: '',
    password: '',
    passwordConfirm: '',
    email: '',
    name: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
    setError('');
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    
    // ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏
    if (formData.password !== formData.passwordConfirm) {
      setError('ÎπÑÎ∞ÄÎ≤àÌò∏Í∞Ä ÏùºÏπòÌïòÏßÄ ÏïäÏäµÎãàÎã§.');
      return;
    }

    setLoading(true);

    try {
      const { passwordConfirm, ...registerData } = formData;
      await AuthService.register(registerData);
      
      // ÌöåÏõêÍ∞ÄÏûÖ ÏÑ±Í≥µ
      alert('ÌöåÏõêÍ∞ÄÏûÖÏù¥ ÏôÑÎ£åÎêòÏóàÏäµÎãàÎã§!');
      navigate('/dashboard');
    } catch (err) {
      if (err.error?.details) {
        // Ïú†Ìö®ÏÑ± Í≤ÄÏÇ¨ ÏóêÎü¨
        const errorMessages = err.error.details.map(d => d.message).join('\n');
        setError(errorMessages);
      } else {
        setError(err.error?.message || 'ÌöåÏõêÍ∞ÄÏûÖÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§');
      }
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-container">
      <div className="auth-box">
        <h1 className="auth-title">ÌöåÏõêÍ∞ÄÏûÖ</h1>
        <p className="auth-subtitle">RecipeNoteÏôÄ Ìï®Íªò ÏãúÏûëÌïòÏÑ∏Ïöî üéâ</p>

        {error && (
          <div style={{
            padding: '12px',
            background: '#FEE',
            color: '#C53030',
            borderRadius: '8px',
            marginBottom: '20px',
            fontSize: '14px',
            fontWeight: '500',
            whiteSpace: 'pre-line'
          }}>
            {error}
          </div>
        )}

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>ÏïÑÏù¥Îîî *</label>
            <input
              type="text"
              name="username"
              value={formData.username}
              onChange={handleChange}
              placeholder="4-20Ïûê, ÏòÅÎ¨∏+Ïà´Ïûê"
              required
              disabled={loading}
            />
            <p className="form-hint">ÏòÅÎ¨∏ ÏÜåÎ¨∏ÏûêÏôÄ Ïà´ÏûêÎßå ÏÇ¨Ïö© Í∞ÄÎä•Ìï©ÎãàÎã§</p>
          </div>

          <div className="form-group">
            <label>ÎπÑÎ∞ÄÎ≤àÌò∏ *</label>
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              placeholder="8Ïûê Ïù¥ÏÉÅ, ÏòÅÎ¨∏+Ïà´Ïûê+ÌäπÏàòÎ¨∏Ïûê"
              required
              disabled={loading}
            />
            <p className="form-hint">ÏïàÏ†ÑÌïú ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏÇ¨Ïö©ÌïòÏÑ∏Ïöî</p>
          </div>

          <div className="form-group">
            <label>ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏ *</label>
            <input
              type="password"
              name="passwordConfirm"
              value={formData.passwordConfirm}
              onChange={handleChange}
              placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏Î•º Îã§Ïãú ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
              required
              disabled={loading}
            />
          </div>

          <div className="form-group">
            <label>Ïù¥Î©îÏùº *</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="example@email.com"
              required
              disabled={loading}
            />
            <p className="form-hint">Ïù¥Î©îÏùº Ïù∏Ï¶ùÏù¥ ÌïÑÏöîÌï©ÎãàÎã§</p>
          </div>

          <div className="form-group">
            <label>Ïù¥Î¶Ñ *</label>
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              placeholder="Ïù¥Î¶ÑÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
              required
              disabled={loading}
            />
          </div>

          <button 
            type="submit" 
            className="btn-primary"
            disabled={loading}
          >
            {loading ? 'Í∞ÄÏûÖ Ï§ë...' : 'Í∞ÄÏûÖÌïòÍ∏∞'}
          </button>

          <button
            type="button"
            className="btn-secondary"
            onClick={() => navigate('/login')}
            disabled={loading}
          >
            Ïù¥ÎØ∏ Í≥ÑÏ†ïÏù¥ ÏûàÏúºÏã†Í∞ÄÏöî? Î°úÍ∑∏Ïù∏
          </button>
        </form>
      </div>
    </div>
  );
}

export default RegisterPage;
